import React from "react"

import Filmovi from "./Filmovi"
import NoviFilm from "./NoviFilm"
import Users from "./Users"

function Main(props){

    const noviFilm=props.state.NoviFilm === true && <NoviFilm handleToUpdateAdd={props.handleToUpdateAdd} filmovi={props.state.filmovi}/>
    const users=props.state.Users === true && <Users />
    return(
        <div id="main">
            <Filmovi handleToUpdateDelete={props.handleToUpdateDelete} filmovi={props.state.filmovi} />
            {noviFilm}
            {users}
        </div>
    )
}

export default Main
